import axios from 'axios';

export const GET_REGION = 'GET_REGION';

export const getRegion = () => {
  axios.get('http://api.training.div3.pgtest.co/api/v1/location').then((res) => {
    return {
      region: res.data.data,
    };
  });
  return { type: GET_REGION };
};
